import React from 'react';
import './OvenItem.css';
import Loader from "../reusableComponents/Loader";


class OvenItem extends React.Component{

    ovenState(state){
        if (state=== 'Active')
            return (<div><span className="green"/></div>)
        else return (<div><span className="yellow"/></div>)
    }

    render(){

    let ovenview=null;

    if( this.props.data.get("Name")!= null ) {
        const data=this.props.data;
        console.log(data.get("Name"));
        ovenview = <div className="oven-wrapper" key={data.get("Name")}>
            <div className="oven-section1">
                <div className="dotOven green"></div>
                <div>{data.get("Name")}</div>
                <div > CurrentTemperature {data.get("CurrentTemperature")} C</div>
            </div>
            <div className="oven-section2">
                Profile:{data.get("ProgramName")}     Goal:{data.get("GoalTemperature")} C    Mode: {data.get("Mode")}
            </div>
            <div className="oven-section3">
                <div>ready: {data.get("ReadyForSelfTest")!=null ? data.get("ReadyForSelfTest") : 0}</div>
                <div>available {data.get("Available")!=null ? data.get("Available") : 0}</div>
                <div>found {data.get("Found")!=null ? data.get("Found") : 0}</div>
                <div>NF {data.get("NotFound")!=null ? data.get("NotFound") : 0}</div>
                <div>NA {data.get("NotAvailable")!=null ? data.get("NotAvailable") : 0}</div>
            </div>
            <div className="oven-section4">
                analytics
                <ul>
                    <li>FLX50000 hasnt been used for 2 weeks</li>
                </ul>
            </div>
        </div>
    }


    return(
        <div>
            {ovenview ? ovenview : <Loader/>}
        </div>
    )
}
}

export default OvenItem;
